import React, { useState } from 'react';
import { Tabs, TabsContent, TabsList, TabsTrigger } from './components/ui/tabs';
import { DocumentEditor } from './components/DocumentEditor';
import { DocumentList } from './components/DocumentList';
import { SearchPanel } from './components/SearchPanel';
import { Document } from './types';
import { Shield, FileText, Search } from 'lucide-react';

function App() {
  const [selectedDocument, setSelectedDocument] = useState<Document | null>(null);
  const [activeTab, setActiveTab] = useState('documents');

  const handleDocumentSelect = (document: Document) => {
    setSelectedDocument(document);
    setActiveTab('editor');
  };

  const handleNewDocument = () => {
    setSelectedDocument(null);
    setActiveTab('editor');
  };

  const handleDocumentSave = (document: Document) => {
    setSelectedDocument(document);
  };

  return (
    <div className="min-h-screen bg-background">
      {/* Header */}
      <header className="border-b bg-card">
        <div className="container mx-auto px-4 py-4">
          <div className="flex items-center justify-between">
            <div className="flex items-center gap-3">
              <Shield className="h-8 w-8 text-primary" />
              <div>
                <h1 className="text-2xl font-bold">Stealth Legal AI</h1>
                <p className="text-sm text-muted-foreground">
                  Document Management & Redlining Service
                </p>
              </div>
            </div>
            <div className="text-sm text-muted-foreground">
              {selectedDocument && (
                <span>Editing: {selectedDocument.title}</span>
              )}
            </div>
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main className="container mx-auto px-4 py-6">
        <Tabs value={activeTab} onValueChange={setActiveTab} className="space-y-6">
          <TabsList className="grid w-full grid-cols-3">
            <TabsTrigger value="documents" className="flex items-center gap-2">
              <FileText className="h-4 w-4" />
              Documents
            </TabsTrigger>
            <TabsTrigger value="editor" className="flex items-center gap-2">
              <FileText className="h-4 w-4" />
              Editor
            </TabsTrigger>
            <TabsTrigger value="search" className="flex items-center gap-2">
              <Search className="h-4 w-4" />
              Search
            </TabsTrigger>
          </TabsList>

          <TabsContent value="documents" className="space-y-6">
            <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
              <div className="lg:col-span-1">
                <DocumentList
                  onDocumentSelect={handleDocumentSelect}
                  onNewDocument={handleNewDocument}
                  selectedDocumentId={selectedDocument?.id}
                />
              </div>
              <div className="lg:col-span-2">
                <div className="bg-muted/50 rounded-lg p-8 text-center">
                  <FileText className="h-12 w-12 mx-auto mb-4 text-muted-foreground" />
                  <h3 className="text-lg font-medium mb-2">Select a Document</h3>
                  <p className="text-muted-foreground">
                    Choose a document from the list to start editing, or create a new one.
                  </p>
                </div>
              </div>
            </div>
          </TabsContent>

          <TabsContent value="editor" className="space-y-6">
            <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
              <div className="lg:col-span-1">
                <DocumentList
                  onDocumentSelect={handleDocumentSelect}
                  onNewDocument={handleNewDocument}
                  selectedDocumentId={selectedDocument?.id}
                />
              </div>
              <div className="lg:col-span-2">
                <DocumentEditor
                  documentId={selectedDocument?.id}
                  onSave={handleDocumentSave}
                />
              </div>
            </div>
          </TabsContent>

          <TabsContent value="search" className="space-y-6">
            <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
              <div className="lg:col-span-1">
                <DocumentList
                  onDocumentSelect={handleDocumentSelect}
                  onNewDocument={handleNewDocument}
                  selectedDocumentId={selectedDocument?.id}
                />
              </div>
              <div className="lg:col-span-2">
                <SearchPanel
                  documentId={selectedDocument?.id}
                  onDocumentSelect={(documentId) => {
                    // Find the document and select it
                    // In a real app, you'd fetch the document details
                    setActiveTab('editor');
                  }}
                />
              </div>
            </div>
          </TabsContent>
        </Tabs>
      </main>

      {/* Footer */}
      <footer className="border-t bg-card mt-12">
        <div className="container mx-auto px-4 py-6">
          <div className="text-center text-sm text-muted-foreground">
            <p>Stealth Legal AI - Document Management Service</p>
            <p className="mt-1">
              Built with FastAPI, React, and shadcn/ui
            </p>
          </div>
        </div>
      </footer>
    </div>
  );
}

export default App;
